// SPDX-License-Identifier: BUSL-1.1
pragma solidity >=0.8.0;

import './interfaces/IEnstarV1ProjectDeployer.sol';

import './EnstarV1Project.sol';

contract EnstarV1ProjectDeployer is IEnstarV1ProjectDeployer {
    struct Parameters {
        address factory;
        address tokenCP;
        address tokenVC;
        uint24 fee;
    }

    /// @inheritdoc IEnstarV1ProjectDeployer
    Parameters public override parameters;

    /// @dev Deploys a pool with the given parameters by transiently setting the parameters storage slot and then
    /// clearing it after deploying the pool.
    function deploy(
        address factory,
        address tokenCP,
        address tokenVC,
        uint24 fee
    ) internal returns (address pool) {
        parameters = Parameters({factory: factory, tokenCP: tokenCP, tokenVC: tokenVC, fee: fee});
        pool = address(new EnstarV1Project{salt: keccak256(abi.encode(tokenCP, tokenVC, fee))}());
        delete parameters;
    }
}
